import {useEffect , useState} from "react"

export default function ProductsArray(){

    const [product , setProduct] = useState({})

    useEffect(() => {
        fetch('https://fakestoreapi.com/products/')
            .then(res=>res.json())
            .then(json=>setProduct(json))
    }, []);

    return product 

    
}
